import "./mainPage.css";
import { motion } from "framer-motion";

function mainPage() {
  return (
    <div className="App">
      <header className="App-header">
        <motion.img
          animate={{ x: 100 }}
          transition={{ ease: "easeOut", duration: 2 }}
          alt="sunset logo"
          src="favicon.ico"
          width={"100px"}
        />
      </header>
    </div>
  );
}

export default mainPage;
